let alunos = [], semanainfo, datedif, turmainfo, dados
function enviar()
{
    if (document.getElementById("nome").value != ""  && document.getElementById("idcurso").selectedIndex != 0 && document.getElementById("idfun").selectedIndex != 0)
        document.form.submit()
}
function montarDias()
{
    let t = "", n = "Segunda,Terça,Quarta,Quinta,Sexta".split(","),c = 0
    for (let i of n)
        t += "<div><label>" + ((semanainfo.charAt(c++) == 1) ? "X " : " ") + i + "</label></div>"
    document.getElementById("dias").innerHTML = t
}
function voltar()
{
    location.href = "turmaList.php"
}
function init()
{
    ler()
    montarDias()
}
function ler()
{
    el = getJSON("../api/turma/ver.php?" + location.href.split("?")[1])[0]
    dados = el
    dfecha = el.dtfechamento
    semanainfo = el["semana"]
    document.form.action += "?" + el["id"]
    document.getElementById("status").selectedIndex = parseInt(el["status"])
    l = Object.keys(el)
    l.splice(0, 1)
    // l.pop()
    for (let i of l)
    {
        document.getElementById(i).value = el[i]
        document.getElementById(i).disabled = true
    }
    el = getJSON("../api/turma/ver2.php?" + location.href.split("?")[1])[0]
    turmainfo = el
    document.getElementById("idcurso").value = el["idcurso"]
    document.getElementById("idfun").value = el["idfun"]
    alunos = getJSON("../api/matricula/listEsp.php?" + location.href.split("?")[1])
    if (alunos.length != 0)
    {
        document.getElementById("btnAula").addEventListener("click", function(){location.href = 'aulaList.php?' + location.href.split("?")[1]})
        document.getElementById("btnAval").addEventListener("click", function(){location.href = 'avalList.php?'+ location.href.split("?")[1]})
    }
    else
    {
        document.getElementById("btnAula").style.display = "none"
        document.getElementById("btnAval").style.display = "none"
    }
    a = new Date()
    b = new Date('2019-9-22')
    c = new Date()

    datedif = Math.abs((a - c)/86400000)

    montarLista()
}
function montarLista()
{
    let t = "", contador = 0
    if (alunos.length == 0)
    {
        t += "Nenhum aluno na turma"
    }
    else
        for (let i of alunos)
            t += "<div>" + i.nome + "</div><button type='button' onclick='gerarCertificado(" + ((datedif < 1 && parseFloat(i.media) > 3) ? 0 : 1) + "," + contador++ + ")'>Gerar Certificado</button>"
    document.getElementById("lista").innerHTML = t
}
function gerarCertificado(tipo, aluno)
{
    if (tipo == 1)
    {
        alert("Não é possível gerar o certificado.\nMédia inferior a 6 ou o aluno não\ncompareceu 100% ao curso")
        return
    }
    else
        gerarPdf(aluno)
}
